/* eslint-disable class-methods-use-this */
import {
  post,
  get,
  put,
  _delete
} from '@/lin/plugin/axios'

export default class Admin {
  constructor(uPage = 0, uCount = 10, gPage = 0, gCount = 5) {
    this.uPage = uPage
    this.uCount = uCount
    this.lPage = gPage
    this.gCount = gCount
  }

  async increaseUPage() {
    this.uPage += 1
  }

  async increaseGPage() {
    this.lPage += 1
  }

  async decreaseUPage() {
    this.uPage -= 1
    if (this.uPage < 0) {
      this.uPage = 0
    }
  }

  async decreaseGPage() {
    this.lPage -= 1
    if (this.lPage < 0) {
      this.lPage = 0
    }
  }

  static getAllPermissions() {
    return get('recruit/admin/permission')
  }

  static async getAdminUsers({
    group_id,
    count = this.uCount,
    page = this.uPag
  }) {
    let res
    if (group_id) {
      res = await get('recruit/admin/users', {
        count,
        page,
        group_id,
      })
    } else {
      res = await get('recruit/admin/users', {
        count,
        page,
      })
    }
    return res
  }

  async nextUsersPage() {
    await this.increaseUPage()
    return this.getAdminUsers({})
  }

  async preUsersPage() {
    await this.decreaseUPage()
    return this.getAdminUsers({})
  }

  async getGroupsWithPermissions({
    count = this.uCount,
    page = this.uPag
  }) {
    const res = await get('recruit/admin/groups', {
      count,
      page,
    })
    return res
  }

  async nextGroupsPage() {
    await this.increaseGPage()
    return this.getGroupsWithPermissions({})
  }

  async preGroupsPage() {
    await this.decreaseGPage()
    return this.getGroupsWithPermissions({})
  }

  static async getAllGroups() {
    const groups = await get('recruit/admin/group/all')
    return groups
  }

  static async getOneGroup(id) {
    const group = await get(`recruit/admin/group/${id}`)
    return group
  }

  static async createOneGroup(name, info, permission_ids) {
    const res = await post('recruit/admin/group', {
      name,
      info,
      permission_ids,
    })
    return res
  }

  static async updateOneGroup(name, info, id) {
    const res = await put(`recruit/admin/group/${id}`, {
      name,
      info,
    })
    return res
  }

  static async deleteOneGroup(id) {
    const res = await _delete(`recruit/admin/group/${id}`)
    return res
  }

  static async deleteOneUser(id) {
    const res = await _delete(`recruit/admin/user/${id}`)
    return res
  }

  static async updateOneUser(email, group_ids, id) {
    const res = await put(`recruit/admin/user/${id}`, {
      email,
      group_ids,
    })
    return res
  }

  static async dispatchPermissions(group_id, permission_ids) {
    const res = await post('recruit/admin/permission/dispatch/batch', {
      group_id,
      permission_ids,
    })
    return res
  }

  static async changePassword(new_password, confirm_password, id) {
    const res = await put(`recruit/admin/user/${id}/password`, {
      new_password,
      confirm_password,
    })
    return res
  }

  static async removePermissions(group_id, permission_ids) {
    const res = await post('recruit/admin/permission/remove', {
      group_id,
      permission_ids,
    })
    return res
  }
}
